import styles from './carousel.module.scss'
import cx from 'classnames'

const Carousel = () => {
  // setInterval(() => {
  //   console.log('fdsfdsf')
  // }, 3000)
  return (
    <div>
      <h2 className={styles.test}> Single Item</h2>
      <div className={styles.slider}>
        <ul className={styles.wrapper}>
          <li className={styles.box1} data-value={1}>
            1
          </li>
          <li className={styles.box2} data-value={2}>
            2
          </li>
          <li className={styles.box3} data-value={3}>
            3
          </li>
        </ul>
      </div>
    </div>
  )
}

export default Carousel
